import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import { Typography, Box, Button, Grid, Card, CardMedia, CardContent } from '@mui/material';

interface Racquet {
  id: number;
  name: string;
  image: string;
}

const RacquetPage: React.FC = () => {
  const { brand } = useParams<{ brand: string }>();
  const [racquets, setRacquets] = useState<Racquet[]>([]);

  useEffect(() => {
    // 브랜드에 따라 라켓 정보 fetch
    // 예: GET /api/racquets?brand=wilson
    // 아래는 임시 mock 데이터
    if (brand) {
      fetch(`/api/racquets?brand=${brand}`)
        .then(res => res.json())
        .then(data => setRacquets(data))
        .catch(console.error);
    }
  }, [brand]);

  return (
    <Box sx={{ width: '100%', p: 4 }}>
      <Typography variant="h4" sx={{ fontWeight: 'bold', mb: 2 }}>
        {brand ? `${brand.charAt(0).toUpperCase()}${brand.slice(1)}` : 'All'} Tennis Racquets
      </Typography>
      <Typography variant="body1" sx={{ mb: 4 }}>
        To speak with a racquet specialist please call <a href="tel:1-800-799-9230">1-800-799-9230</a>
      </Typography>
      <Button variant="outlined" sx={{ mb: 4 }}>Notify Me</Button>

      {/* 필터 버튼들 (예: All, Best Sellers, etc.) */}
      <Box sx={{ display: 'flex', gap: 2, mb: 4, flexWrap: 'wrap' }}>
        <Button variant="contained">All</Button>
        <Button variant="outlined">Best Sellers</Button>
        <Button variant="outlined">Best Deals</Button>
        <Button variant="outlined">Spin</Button>
        <Button variant="outlined">Modern</Button>
        <Button variant="outlined">All Around</Button>
        <Button variant="outlined">Power/Oversize</Button>
        <Button variant="outlined">Control/Traditional</Button>
      </Box>

      <Grid container spacing={2}>
        {racquets.map(racquet => (
          <Grid item key={racquet.id} xs={6} sm={4} md={3}>
            <Card>
              <CardMedia
                component="img"
                image={racquet.image}
                alt={racquet.name}
                sx={{ height: 200, objectFit: 'contain', p: 2 }}
              />
              <CardContent>
                <Typography variant="subtitle1" align="center">
                  {racquet.name}
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default RacquetPage;
